import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Col, Row } from 'react-bootstrap';

function App() {
  const [formulario, setFormulario] = useState({
    numero1: '',
    numero2: '',
    resultado: '',
    suma: '',
    resta: '',
    multiplicacion: '',
    division: '',
  });

  const handleChange = (event) => {
    const temporal = { ...formulario };
    temporal[event.target.name] = event.target.value;
    setFormulario(temporal);
  };

  const handleSuma = () => {
    const { numero1, numero2 } = formulario;
    const suma = parseFloat(numero1) + parseFloat(numero2);
    setFormulario({ ...formulario, suma: suma.toString() });
  };

  const handleResta = () => {
    const { numero1, numero2 } = formulario;
    const resta = parseFloat(numero1) - parseFloat(numero2);
    setFormulario({ ...formulario, resta: resta.toString() });
  };

  const handleMultiplicacion = () => {
    const { numero1, numero2 } = formulario;
    const multiplicacion = parseFloat(numero1) * parseFloat(numero2);
    setFormulario({ ...formulario, multiplicacion: multiplicacion.toString() });
  };

  const handleDivision = () => {
    const { numero1, numero2 } = formulario;
    const division = parseFloat(numero1) / parseFloat(numero2);
    setFormulario({ ...formulario, division: division.toString() });
  };

  return (
    <div className="App">
      <Container>
        <Form>
          <Row>
            <Col>
              <Form.Text className="text-muted">Calculadora JavaScript.</Form.Text>
              <Form.Group className="mb-3">
                <Form.Label>Número 1</Form.Label>
                <Form.Control
                  onChange={handleChange}
                  name="numero1"
                  type="number"
                  placeholder="Ingrese un número"
                />
              </Form.Group>

              <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>Número 2</Form.Label>
                <Form.Control
                  onChange={handleChange}
                  name="numero2"
                  type="number"
                  placeholder="Ingrese un número"
                />
              </Form.Group>

              <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>Resultado</Form.Label>
                <Form.Control
                  value={formulario.resultado}
                  name="resultado"
                  type="number"
                  placeholder=""
                  readOnly
                />
              </Form.Group>
            </Col>
            <Col>
              <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>Suma</Form.Label>
                <Form.Control
                  value={formulario.suma}
                  name="suma"
                  type="number"
                  placeholder="Sume"
                  readOnly
                />
              </Form.Group>

              <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>Resta</Form.Label>
                <Form.Control
                  value={formulario.resta}
                  name="resta"
                  type="number"
                  placeholder="Reste"
                  readOnly
                />
              </Form.Group>

              <Form.Group className="mb-3" controlId="formBasicPassword">
              <Form.Label>Multiplicación</Form.Label>
              <Form.Control
                value={formulario.multiplicacion}
                name="multiplicacion"
                type="number"
                placeholder="Multiplique"
                readOnly
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicPassword">
              <Form.Label>División</Form.Label>
              <Form.Control
                value={formulario.division}
                name="division"
                type="number"
                placeholder="Divida"
                readOnly
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicCheckbox">
              <Form.Check type="checkbox" label="Check me out" />
            </Form.Group>

            <Button variant="primary" type="button" onClick={handleSuma}>
              Sumar
            </Button>
            <Button variant="primary" type="button" onClick={handleResta}>
              Restar
            </Button>
            <Button variant="primary" type="button" onClick={handleMultiplicacion}>
              Multiplicar
            </Button>
            <Button variant="primary" type="button" onClick={handleDivision}>
              Dividir
            </Button>
          </Col>
        </Row>
      </Form>
    </Container>
  </div>
);
}

export default App;
